Stepping Into the New Season with Next

Go behind the scenes of a recent shoot I did with @nextofficial_me and the incredible @rebeccaspencer_photography for its SS25 collection.

I got to be one of the first to discover its stunning curation of wardrobe essentials, from classic basics to statement pieces. 

First up had to be this @cathkidston floral number perfect for twirling around in golden hour. 

Head to it’s Next.ae now to discover more now. 

